import React, {Component} from 'react';



class Section extends Component{

  render(){
    const doctors = [
      {
        'name' : 'Nathan Sumilang',
        'description' : 'TODO'
      },
      {
        'name' : 'TODO Name',
        'description' : 'TODO description'
      }
    ];
    //TODO : Add images to the slideshow
    const slideImages = [];
    return(
      //<AboutUs />
      <Doctor doctor={doctors}/>
    );
  }
}
