const Doctor = props =>{
  const doctors = props.doctor.map((doctor, index) =>{
    return(
      <div key={index}>
        <div>{doctor.name}</div>
        <div>{doctor.description}</div>
      </div>
    );
  });
  return <div>{doctors}</div>
}
